import { Outlet, Link } from "react-router-dom";
import Login from "../Login";
import "./styles.css";

const Layout = () => {
  return (
    <>
        <div className="head">Lab On Web
      <nav className="nav">
        <Link to="/">Home</Link>
        <Link to="/Experiments">Experiments</Link>
        <Link to="/About">About</Link>
        <Login/>
      </nav>
      </div>
      <Outlet />
    </>
  )
};

export default Layout
